        <div className="component">
            <ul className="category-items">
                <li>Available Categories</li>
                <li>Comment</li>
                <li>Location</li>
            </ul>
            {Hierarchy.map((item, i) => 
            <div key={i}>{item.returnHTML()}</div>)}
            <div>
                <button onClick={(e) => {console.log(Hierarchy)}}>Test</button>
            </div>
        </div>
    )
}
